import React, {useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchOrderProductsByNickname } from '../../features/formSlice';
import { TableBody, TableHead } from './OrderProductsTable';

const OrderedProductsBody = ({date}) => { 
    const store = useSelector(state => state)
    const {productsSlice, formSlice} = store
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchOrderProductsByNickname(formSlice.nickname))
    }, [formSlice.nickname, dispatch])
    return (
        <div className="orderedProductsBody">
            <table className="orderedProductsTableTitle">
                <TableHead />    
                <TableBody product={formSlice.productByNickname} date={date} />
            </table>
        </div>
    )
}

export default OrderedProductsBody
